B.Sq=new A.fK("Hello! I'm Thijs Pirmez, an app developer with a passion for creating innovative solutions. My journey into software development began as a self-taught Android developer\u2014initially a hobby that evolved into a fulfilling career. Prior to venturing into the world of coding, I worked as a technician in wind turbines and held roles as a Project Manager and R&D engineer in the automotive industry. It was during my time as an R&D engineer that I encountered Android development. The moment I started exploring Java and Android Studio, I found myself captivated, dedicating nearly all my free time to mastering the art of developing Android applications.",null,B.cB,null,null,null)
