B.St=new A.fK("I've always held a fascination for software development and have been a fervent smartphone enthusiast since the days of my first Blackberry. Despite not pursuing software engineering in my university studies, the realm of software development remained somewhat of a 'black box' to me during that time. It wasn't until 2021 that I delved into the captivating world of software engineering. In August of that year, I discovered an online tutorial guiding me through the process of creating an app in Android Studio. Soon after, I proudly developed my first app. Two years after that initial foray into Android app development, I took a leap of faith, transitioning from an R&D engineer to an Android & iOS developer. Since making that decision, I've been immersed in this role, primarily crafting applications using the Flutter framework. However, my skill set extends beyond Flutter, encompassing native Android, iOS, and web development.",null,B.cB,null,null,null)
B.Su=new A.fK("While I did not pursue software engineering at the university level, I hold two bachelor's degrees. The first in Mechanical Engineering and Production Technology, which I completed in 2012, and the second in Energy Technology, earned in 2014. Although my interest in software development was always present, it wasn't until later in life that I realized it was a passion I wanted to pursue professionally. Subsequently, I embarked on a journey of self-education, undertaking numerous online courses with a primary focus on app development. My goal was to accumulate sufficient knowledge to secure a position as an app developer. This transformative journey commenced in 2021, and by 2023, I achieved a significant milestone: receiving my first job offer as an app developer!",null,B.cB,null,null,null)
