s($,"aIa","atk",()=>A.a([A.FR("When embarking on a learning journey, starting from the basics and progressively building knowledge is paramount. To gain a comprehensive understanding of app development, I recognized the need to delve deeper into computer science. Harvard's CS50x course, 'Introduction to Computer Science,' came highly recommended and appeared to be the perfect starting point for my journey as an app developer. In August 2022, I successfully completed and graduated from the course.","assets/images/software_computer_science.svg","Computer Science"),A.FR("This is where it all started for me. Online, I stumbled upon a short tutorial for a 'hello world' app in Android Studio. Subsequently, I delved into countless YouTube instructional videos, and not long thereafter, I created my first Android app: a tic-tac-toe game. With much left to learn (and still ongoing), I decided to follow the Android Fundamental Codelabs. Later, I pursued the Kotlin Bootcamp for Programmers on Udacity to deepen my understanding of Kotlin. Up next on my to-do list is Jetpack Compose! To be continued...","assets/images/software_android.svg","Native Android"),A.FR("My journey as a native iOS developer began when I joined the research department of Howest University as an Android and iOS developer. My experience with native iOS development is at the 'entry level.' To kickstart my knowledge in native iOS and Swift, I enrolled in Angela's highly-rated course on Udemy: 'iOS & Swift - The Complete iOS App Development Bootcamp.' However, I haven't yet reached the point where I've created a fully finished native iOS application. My primary focus is on cross-platform development. I believe that possessing some native knowledge in both Android and iOS is essential, which was the main motivation behind taking this course.","assets/images/software_apple.svg","Native iOS"),A.FR("This is my current focus. I strongly believe that cross-platform development is the standard in today's tech landscape. Frameworks like Flutter and React Native have truly demonstrated their potential. While native platform knowledge will always be an important 'bonus card' in your deck, my direction is towards cross-platform development. As a cross-platform developer, I've chosen the Flutter framework. I briefly experimented with React Native, but after experiencing the Flutter framework, I felt more at home. I began with the Udemy course (yes, I really like Udemy when I need to learn new things): 'Flutter & Dart - The Complete Guide.'","assets/images/software_flutter.svg","Cross Platform"),A.FR("As an app developer, I also wanted to gain some experience in web development. Often, when creating an application, the question arises: should I go for a native application or opt for a web application? Additionally, many cross-platform frameworks, such as React Native or Ionic, are built for individuals with web development experience. To ensure I had at least some knowledge of web development, I completed several Codecademy courses (learning HTML, CSS3, A-Frame, Javascript, ...), enrolled myself in two VDAB courses: HTML5 + CSS3 and Javascript, and participated in a bootcamp course about Vue on YouTube.","assets/images/software_vue.svg","Web")],A.Y("u<FQ>")))
s($,"aIK","alB",()=>A.a([A.aoC("My Energy Desk is an application that I developed as the final project for my CS50 course at Harvard. The app is a native Android application written in Java, utilizing Android views. It is designed for individuals who wish to monitor their energy usage on a monthly and yearly basis. The application empowers users to identify anomalies in their energy consumption, providing insights into their yearly usage and offering tips on how to conserve energy. Notably, this app marks my debut on the Play Store. \n\nThe app allows tracking of electricity consumption, electricity production (solar/wind), natural gas, and water usage. Logging is achieved by adding entries (Electricity, water, natural gas) to a local SQLite database. The data is then visually presented on bar graphs, offering users a clear overview of their energy consumption on both a monthly and yearly scale. Furthermore, the database can be exported as an Excel file or a database (.db) file for local backup. In the event of a new phone, users can seamlessly import the database from their local backup, ensuring that their valuable data is retained during the phone transition.","https://play.google.com/store/apps/details?id=com.thpir.myenergydesk&hl=en_US","assets/images/project_energy.png",0,"My Energy Desk app"),A.aoC("The Toolbox app is a comprehensive collection of essential tools that are a must-have on every smartphone. Instead of cluttering your device with various small apps, I have consolidated them into one super-app, creating a digital Swiss army knife! The application is developed using Flutter. \n\nAt the time of this release, the app includes: \n\nA classic ruler app capable of measuring objects the size of your smartphone in millimeters or inches. \n\nA 3D AR ruler app that can measure objects in your room using your camera (also in millimeters or inches). \n\nA compass app with GPS locator. \n\nA QR code scanner/creator that allows you to scan various types of QR codes and barcodes. It also enables you to create your own QR codes and export them to your image gallery in .png format. \n\nA torch with a Morse code encoder, allowing you to translate any text you type into Morse code and signal it with the flashlight on your phone. \n\nA simple calculator app.","https://github.com/thpir/toolbox/releases/tag/Toolbox_V1.1","assets/images/project_toolbox.png",1,"Toolbox app")],A.Y("u<r2>")))
